-- Name: populate_health_plan_effective_date(text, text); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION populate_health_plan_effective_date(db_name text, host text) RETURNS void
    LANGUAGE plpgsql
    AS $$
BEGIN
  INSERT INTO health_plan_effective_date
  (SELECT hp.displayid AS "health_plan_display_id",
          hp.createtimestamp AS "effective_date"
    FROM dblink('dbname='||db_name||' hostaddr='||host,
                'SELECT displayid,
                        createtimestamp,
                        isactive
                  FROM healthplan')
    AS hp(displayid integer, createtimestamp timestamp, isactive boolean)
    WHERE hp.displayid NOT IN (SELECT hped.health_plan_display_id FROM health_plan_effective_date hped)
  );
END
$$;


ALTER FUNCTION public.populate_health_plan_effective_date(db_name text, host text) OWNER TO postgres;

