--
-- TOC entry 2394 (class 1255 OID 33088)
-- Name: populate_hped(text, text, text, text); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION populate_hped(host text, year text, month text, db_name text) RETURNS void
    LANGUAGE plpgsql
    AS $$
BEGIN
  INSERT INTO health_plan_effective_date
  (SELECT hp.displayid AS "health_plan_display_id"
    FROM dblink('dbname='||db_name||' hostaddr='||host,
                'SELECT displayid
                 FROM healthplan')
    AS hp(displayid integer)
    WHERE hp.displayid NOT IN (SELECT hped.health_plan_display_id FROM health_plan_effective_date hped)
  );

  UPDATE health_plan_effective_date hped SET
    effective_date = to_date(year||'-'||month, 'yyyy-mm'),
    end_date = null
  WHERE
  hped.health_plan_display_id IN
  (SELECT hp.displayid
    FROM dblink('dbname='||db_name||' hostaddr='||host,
                'SELECT displayid,
                        isactive
                  FROM healthplan
                  WHERE isactive = true')
    AS hp(displayid integer, isactive boolean)
  )
  AND (hped.effective_date IS null
       OR hped.end_date IS NOT null);

  UPDATE health_plan_effective_date hped SET
    end_date = to_date(year||'-'||month, 'yyyy-mm') 
  WHERE
  hped.health_plan_display_id IN
  (SELECT hp.displayid
    FROM dblink('dbname='||db_name||' hostaddr='||host,
                'SELECT displayid,
                        isactive
                  FROM healthplan
                  WHERE isactive = false')
    AS hp(displayid integer, isactive boolean)
  )
  AND hped.end_date IS null;
END
$$;


ALTER FUNCTION public.populate_hped(host text, year text, month text, db_name text) OWNER TO postgres;

