CREATE FUNCTION update_mv() RETURNS trigger
    LANGUAGE plpgsql
    AS $$
declare

test integer;

BEGIN


  IF tg_op = 'DELETE' THEN

  delete from mv_active_formularies
  where formulary_id =old.formularyfid
  and  drug_id = old.drugfid;

  RETURN old;
  END IF;

  IF tg_op = 'INSERT' THEN

  INSERT into mv_active_formularies
  SELECT fe.formularyfid AS formulary_id, fe.drugfid AS drug_id, fe.tierfid AS tier_id,
  CASE WHEN ((SELECT formularyentryqualifier.qualifierfid FROM formularyentryqualifier
  WHERE ((formularyentryqualifier.formularyentryfid = fe.id) AND (formularyentryqualifier.qualifierfid = 1))) IS NULL) THEN false ELSE true END AS has_quantity_limit,
  CASE WHEN ((SELECT formularyentryqualifier.qualifierfid FROM formularyentryqualifier
  WHERE ((formularyentryqualifier.formularyentryfid = fe.id) AND (formularyentryqualifier.qualifierfid = 2))) IS NULL) THEN false ELSE true END AS has_prior_authorization,
  CASE WHEN ((SELECT formularyentryqualifier.qualifierfid FROM formularyentryqualifier
  WHERE ((formularyentryqualifier.formularyentryfid = fe.id) AND (formularyentryqualifier.qualifierfid = 3))) IS NULL) THEN false ELSE true END AS has_step_therapy,
  CASE WHEN ((SELECT formularyentryqualifier.qualifierfid FROM formularyentryqualifier
  WHERE ((formularyentryqualifier.formularyentryfid = fe.id) AND (formularyentryqualifier.qualifierfid = 4))) IS NULL) THEN false ELSE true END AS has_other_restriction,
  fe.reasoncodefid AS reason_code_id
  FROM formularyentry fe
  WHERE fe.id = new.id
  and ((fe.formularyfid IN
  (SELECT healthplan.formularyfid FROM healthplan WHERE (healthplan.isactive IS TRUE)))
  AND (fe.drugfid IN
  (SELECT drug.id
  FROM drug
  WHERE (drug.isactive IS TRUE))));

 RETURN new;
  END IF;

  IF tg_op = 'UPDATE'  THEN

  UPDATE mv_active_formularies
  set formulary_id = new.formularyfid,
      drug_id  = new.drugfid,
    tier_id  = new.tierfid,
      reason_code_id = new.reasoncodefid,
    has_quantity_limit = CASE WHEN ((SELECT formularyentryqualifier.qualifierfid FROM formularyentryqualifier WHERE ((formularyentryqualifier.formularyentryfid = new.id) AND (formularyentryqualifier.qualifierfid = 1))) IS NULL) THEN false ELSE true END,
    has_prior_authorization = CASE WHEN ((SELECT formularyentryqualifier.qualifierfid FROM formularyentryqualifier WHERE ((formularyentryqualifier.formularyentryfid = new.id) AND (formularyentryqualifier.qualifierfid = 2))) IS NULL) THEN false ELSE true END,
    has_step_therapy = CASE WHEN ((SELECT formularyentryqualifier.qualifierfid FROM formularyentryqualifier WHERE ((formularyentryqualifier.formularyentryfid = new.id) AND (formularyentryqualifier.qualifierfid = 3))) IS NULL) THEN false ELSE true END,
    has_other_restriction = CASE WHEN ((SELECT formularyentryqualifier.qualifierfid FROM formularyentryqualifier WHERE ((formularyentryqualifier.formularyentryfid = new.id) AND (formularyentryqualifier.qualifierfid = 4))) IS NULL) THEN false ELSE true END
      where formulary_id =old.formularyfid
      and  drug_id = old.drugfid;

  RETURN new;

  END IF;

  END
$$;


ALTER FUNCTION public.update_mv() OWNER TO postgres;

--
-- TOC entry 2397 (class 1255 OID 33091)
-- Name: update_mv_hpl(); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION update_mv_hpl() RETURNS trigger
    LANGUAGE plpgsql
    AS $$

BEGIN

  IF tg_op = 'DELETE' or tg_op = 'UPDATE' or tg_op = 'INSERT'
  THEN

  delete from mv_hpl_statefid;

  insert into mv_hpl_statefid
  SELECT healthplanfid, statefid, COALESCE(SUM(lives),0) AS lives
  FROM healthplan_countylives
  GROUP BY healthplanfid, statefid;

  delete from mv_hpl_countyfid;

  insert into mv_hpl_countyfid
  SELECT healthplanfid, countyfid, COALESCE(SUM(lives),0) AS lives
  FROM healthplana_countylives
  GROUP BY healthplanfid, countyfid;


  delete from mv_hpl_metrostatareafid;


  insert into mv_hpl_metrostatareafid
  SELECT healthplanfid, metrostatareafid, COALESCE(SUM(lives),0) AS lives
  FROM healthplan_countylives
  GROUP BY healthplanfid, metrostatareafid;

  RETURN new;

  END IF;


  END
$$;


ALTER FUNCTION public.update_mv_hpl() OWNER TO postgres;

