--
-- TOC entry 1351 (class 1259 OID 38586)
-- Name: health_plan_copay_values; Type: VIEW; Schema: public; Owner: postgres
--

CREATE VIEW health_plan_copay_values AS
 SELECT _hp_.id AS health_plan_id,
    _bscv_.tierfid AS tier_id,
    _bss_.statefid AS state_id,
    _bscv_.value,
    _bscv_.max,
    _bscv_.percentage
   FROM ((((healthplan _hp_
     LEFT JOIN benefitstructure _bs_ ON (((_hp_.id = _bs_.healthplanfid) AND (_bs_.active = 1))))
     LEFT JOIN benefitstructurestate _bss_ ON ((_bs_.id = _bss_.benefitstructurefid)))
     LEFT JOIN benefitstructurecopay _bsc_ ON (((_bsc_.benefitstructurefid = _bs_.id) AND (_bsc_.active = 1))))
     LEFT JOIN benefitstructurecopayvalue _bscv_ ON (((_bsc_.id = _bscv_.benefitstructurecopayfid) AND (_bscv_.active = 1))))
  WHERE (((_hp_.isactive = true) AND (_bsc_.copaytypefid = 2)) AND (_bsc_.pharmacytypefid = 1));


ALTER TABLE health_plan_copay_values OWNER TO postgres;

