--
-- TOC entry 1465 (class 1259 OID 38960)
-- Name: ims_plan_health_plan_lives_allocation; Type: VIEW; Schema: public; Owner: postgres
--

CREATE VIEW ims_plan_health_plan_lives_allocation AS
 SELECT imshealthplan.id,
    imshealthplan.id AS ims_health_plan_id,
    health_plan_lives.lives AS health_plan_lives,
    ims_plan_lives.lives AS ims_plan_lives,
    ims_plan_count.count AS health_plan_count,
        CASE
            WHEN (ims_plan_lives.lives = (0)::numeric) THEN 'health_plan_count'::text
            ELSE 'lives'::text
        END AS allocation_paradigm,
        CASE
            WHEN (ims_plan_lives.lives = (0)::numeric) THEN (1.0 / (ims_plan_count.count)::numeric)
            ELSE (health_plan_lives.lives / ims_plan_lives.lives)
        END AS allocation
   FROM (((((imshealthplan
     JOIN healthplan ON ((healthplan.id = imshealthplan.healthplanfid)))
     JOIN imsplan ON ((imsplan.id = imshealthplan.imsfid)))
     JOIN ( SELECT healthplan_1.id AS health_plan_id,
            COALESCE(sum(healthplan_countylives.lives), (0)::numeric) AS lives
           FROM (healthplan healthplan_1
             LEFT JOIN healthplan_countylives ON ((healthplan_countylives.healthplanfid = healthplan_1.id)))
          WHERE (healthplan_1.isactive = true)
          GROUP BY healthplan_1.id) health_plan_lives ON ((health_plan_lives.health_plan_id = imshealthplan.healthplanfid)))
     JOIN ( SELECT imsplan_1.id AS ims_plan_id,
            COALESCE(sum(healthplan_countylives.lives), (0)::numeric) AS lives
           FROM (((imsplan imsplan_1
             LEFT JOIN imshealthplan imshealthplan_1 ON ((imshealthplan_1.imsfid = imsplan_1.id)))
             LEFT JOIN healthplan healthplan_1 ON (((healthplan_1.id = imshealthplan_1.healthplanfid) AND (healthplan_1.isactive = true))))
             LEFT JOIN healthplan_countylives ON ((healthplan_countylives.healthplanfid = healthplan_1.id)))
          WHERE (imsplan_1.isactive = true)
          GROUP BY imsplan_1.id) ims_plan_lives ON ((ims_plan_lives.ims_plan_id = imshealthplan.imsfid)))
     JOIN ( SELECT imsplan_1.id AS ims_plan_id,
            count(healthplan_1.id) AS count
           FROM ((imsplan imsplan_1
             LEFT JOIN imshealthplan imshealthplan_1 ON ((imshealthplan_1.imsfid = imsplan_1.id)))
             LEFT JOIN healthplan healthplan_1 ON ((healthplan_1.id = imshealthplan_1.healthplanfid)))
          WHERE ((imsplan_1.isactive = true) AND (healthplan_1.isactive = true))
          GROUP BY imsplan_1.id) ims_plan_count ON ((ims_plan_count.ims_plan_id = imshealthplan.imsfid)))
  WHERE ((healthplan.isactive = true) AND (imsplan.isactive = true));


ALTER TABLE ims_plan_health_plan_lives_allocation OWNER TO postgres;

