--
-- TOC entry 1995 (class 1259 OID 40864)
-- Name: restriction_report_provider_last_updated; Type: VIEW; Schema: public; Owner: postgres
--

CREATE VIEW restriction_report_provider_last_updated AS
 SELECT hp.providerfid AS provider_id,
        CASE
            WHEN ((((hpt.webname)::text = 'Medicare MA'::text) OR ((hpt.webname)::text = 'Medicare SN'::text)) OR ((hpt.webname)::text = 'Medicare PDP'::text)) THEN 'Medicare'::character varying
            ELSE hpt.webname
        END AS health_plan_type,
    fce.reportfid AS report_id,
    max(fce.lastupdate) AS entry_last_updated_at
   FROM ((healthplan hp
     JOIN feqcriteriaentry fce ON ((hp.id = fce.healthplanfid)))
     JOIN healthplantype hpt ON ((hp.healthplantypefid = hpt.id)))
  GROUP BY hp.providerfid,
        CASE
            WHEN ((((hpt.webname)::text = 'Medicare MA'::text) OR ((hpt.webname)::text = 'Medicare SN'::text)) OR ((hpt.webname)::text = 'Medicare PDP'::text)) THEN 'Medicare'::character varying
            ELSE hpt.webname
        END, fce.reportfid;


ALTER TABLE restriction_report_provider_last_updated OWNER TO postgres;

