    bscv.tierfid AS tier_id,
    COALESCE(bscv.value) AS copay_value,
    COALESCE(bscv.percentage) AS copay_percentage
   FROM ((((benefitstructurecopayvalue bscv
     JOIN benefitstructurecopay bsc ON ((bscv.benefitstructurecopayfid = bsc.id)))
     JOIN benefitstructure bs ON ((bsc.benefitstructurefid = bs.id)))
     JOIN benefitstructurepharmacytype bspt ON ((bsc.pharmacytypefid = bspt.id)))
     JOIN benefitstructurecopaytype bsct ON ((bsc.copaytypefid = bsct.id)))
  WHERE ((bspt.id = 1) AND (bsct.id = 2));


