--
-- TOC entry 2340 (class 1259 OID 42249)
-- Name: v_plan_copay_min_max; Type: VIEW; Schema: public; Owner: postgres
--

CREATE VIEW v_plan_copay_min_max AS
 SELECT a.health_plan_id,
    a.tier_id,
    COALESCE(a.min_copay_value, (0)::numeric) AS min_copay_value,
    COALESCE(b.max_copay_value, (0)::numeric) AS max_copay_value,
    COALESCE(c.min_copay_percentage, (0)::numeric) AS min_copay_percentage,
    COALESCE(d.max_copay_percentage, (0)::numeric) AS max_copay_percentage
   FROM (((( SELECT v_plan_copay.health_plan_id,
            v_plan_copay.tier_id,
            min(v_plan_copay.copay_value) AS min_copay_value
           FROM v_plan_copay
          GROUP BY v_plan_copay.health_plan_id, v_plan_copay.tier_id) a
     LEFT JOIN ( SELECT v_plan_copay.health_plan_id,
            v_plan_copay.tier_id,
            max(v_plan_copay.copay_value) AS max_copay_value
           FROM v_plan_copay
          GROUP BY v_plan_copay.health_plan_id, v_plan_copay.tier_id) b ON (((a.health_plan_id = b.health_plan_id) AND (a.tier_id = b.tier_id))))
     LEFT JOIN ( SELECT v_plan_copay.health_plan_id,
            v_plan_copay.tier_id,
            min(v_plan_copay.copay_percentage) AS min_copay_percentage
           FROM v_plan_copay
          GROUP BY v_plan_copay.health_plan_id, v_plan_copay.tier_id) c ON (((a.health_plan_id = c.health_plan_id) AND (a.tier_id = c.tier_id))))
     LEFT JOIN ( SELECT v_plan_copay.health_plan_id,
            v_plan_copay.tier_id,
            max(v_plan_copay.copay_percentage) AS max_copay_percentage
           FROM v_plan_copay
          GROUP BY v_plan_copay.health_plan_id, v_plan_copay.tier_id) d ON (((a.health_plan_id = d.health_plan_id) AND (a.tier_id = d.tier_id))));


