    a.formularyfid AS formulary_id,
    d.id AS drug_id,
    d.displayid AS drug_display_id,
    d.name AS drug_name,
    d.isgeneric AS is_generic_drug,
    d.is_multi_source AS is_multi_source_drug,
    fe.tierfid AS tier_id,
    t.name AS tier_name,
        CASE
            WHEN (feq1.pa = 1) THEN 1
            ELSE 0
