    fe.reasoncodefid AS reason_code_id,
    rc.code AS reason_code,
    rc.text AS reason_code_text,
    fe.restriction_comments,
    fe.updated_at,
    fe.id AS formulary_entry_id
   FROM ((((((((((((healthplan a
     JOIN formulary f ON ((a.formularyfid = f.id)))
     JOIN formularyentry fe ON ((a.formularyfid = fe.formularyfid)))
     JOIN tier t ON ((fe.tierfid = t.id)))
     JOIN drug d ON ((fe.drugfid = d.id)))
     JOIN healthplantype hpt ON ((a.healthplantypefid = hpt.id)))
     LEFT JOIN ( SELECT 1 AS pa,
            formularyentryqualifier.formularyentryfid
           FROM formularyentryqualifier
          WHERE (formularyentryqualifier.qualifierfid = 2)) feq1 ON ((fe.id = feq1.formularyentryfid)))
     LEFT JOIN ( SELECT 1 AS ql,
            formularyentryqualifier.formularyentryfid
           FROM formularyentryqualifier
          WHERE (formularyentryqualifier.qualifierfid = 1)) feq2 ON ((fe.id = feq2.formularyentryfid)))
