--
-- TOC entry 2355 (class 1259 OID 42322)
-- Name: view_active_health_plans_zip_lives; Type: VIEW; Schema: public; Owner: postgres
--

CREATE VIEW view_active_health_plans_zip_lives AS
 SELECT totals.county_id,
    totals.county_name,
    totals.county_population,
    totals.healthplanfid,
    totals.formularyfid,
    totals.county_lives,
    totals.county_total_zip_population,
    totals.state_abbreviation,
    totals.zipcode,
    totals.zip_population,
    (totals.zip_population_percentage * 100.0) AS zip_population_percentage,
    (totals.county_lives * totals.zip_population_percentage) AS zip_code_lives
   FROM ( SELECT c.id AS county_id,
            c.name AS county_name,
            c.population AS county_population,
            s.abbreviation AS state_abbreviation,
            county_totals.healthplanfid,
            county_totals.formularyfid,
            county_totals.county_lives,
            county_totals.county_total_zip_population,
            z.zipcode,
            z.population AS zip_population,
                CASE
                    WHEN (county_totals.county_total_zip_population = 0) THEN (0)::numeric
                    ELSE ((z.population)::numeric / (county_totals.county_total_zip_population)::numeric)
                END AS zip_population_percentage
           FROM ((((( SELECT hcl2.healthplanfid,
                    hp.formularyfid,
                    hcl2.lives AS county_lives,
                    hcl2.countyfid,
                    sum(z2.population) AS county_total_zip_population
                   FROM (((((healthplan_countylives hcl2
                     JOIN county c2 ON ((hcl2.countyfid = c2.id)))
                     JOIN state s2 ON ((c2.statefid = s2.id)))
                     JOIN county_zipcode cz2 ON ((hcl2.countyfid = cz2.countyfid)))
                     JOIN zipcode z2 ON (((cz2.zipcodefid = z2.id) AND (z2.usps_active = true))))
                     JOIN healthplan hp ON (((hcl2.healthplanfid = hp.id) AND (hp.isactive = true))))
                  GROUP BY hcl2.lives, hcl2.countyfid, hcl2.healthplanfid, hp.formularyfid) county_totals
             JOIN county c ON ((county_totals.countyfid = c.id)))
             JOIN county_zipcode cz ON ((county_totals.countyfid = cz.countyfid)))
             JOIN state s ON ((c.statefid = s.id)))
             JOIN zipcode z ON (((cz.zipcodefid = z.id) AND (z.usps_active = true))))) totals;


ALTER TABLE view_active_health_plans_zip_lives OWNER TO postgres;

