--
-- TOC entry 2359 (class 1259 OID 42342)
-- Name: view_orencia_sc_formulary_entries; Type: VIEW; Schema: public; Owner: postgres
--

CREATE VIEW view_orencia_sc_formulary_entries AS
 SELECT hp.id AS health_plan_id,
    fe.formularyfid AS formulary_id,
    fe.tierfid AS tier_id,
    rc.id AS reason_code_id,
    rc.code AS reason_code_code,
    rc.webtext AS reason_code_text,
        CASE
            WHEN (pa.id IS NOT NULL) THEN ( SELECT COALESCE(max(bd.display), 1) AS "coalesce"
               FROM ((((feqcriteriaentry fce
                 JOIN criteriaentry ce ON ((fce.criteriaentryfid = ce.id)))
                 JOIN restrictionreport rr ON ((fce.reportfid = rr.id)))
                 JOIN restrictionreportsite rrs ON ((rr.id = rrs.reportfid)))
                 JOIN bms_restriction_code_display bd ON ((ce.criteriafid = bd.criteria_id)))
              WHERE (((((fce.feqfid = pa.id) AND (fce.reportfid = 30)) AND (rrs.sitefid = 3)) AND ((fce.restrictionflag)::text = 'yes'::text)) AND (bd.qualifier_id = 2)))
            ELSE 0
        END AS display_pa,
        CASE
            WHEN (ql.id IS NOT NULL) THEN ( SELECT COALESCE(max(bd.display), 1) AS "coalesce"
               FROM ((((feqcriteriaentry fce
                 JOIN criteriaentry ce ON ((fce.criteriaentryfid = ce.id)))
                 JOIN restrictionreport rr ON ((fce.reportfid = rr.id)))
                 JOIN restrictionreportsite rrs ON ((rr.id = rrs.reportfid)))
                 JOIN bms_restriction_code_display bd ON ((ce.criteriafid = bd.criteria_id)))
              WHERE (((((fce.feqfid = ql.id) AND (fce.reportfid = 30)) AND (rrs.sitefid = 3)) AND ((fce.restrictionflag)::text = 'yes'::text)) AND (bd.qualifier_id = 1)))
            ELSE 0
        END AS display_ql,
        CASE
            WHEN (st.id IS NOT NULL) THEN ( SELECT COALESCE(max(bd.display), 1) AS "coalesce"
               FROM ((((feqcriteriaentry fce
                 JOIN criteriaentry ce ON ((fce.criteriaentryfid = ce.id)))
                 JOIN restrictionreport rr ON ((fce.reportfid = rr.id)))
                 JOIN restrictionreportsite rrs ON ((rr.id = rrs.reportfid)))
                 JOIN bms_restriction_code_display bd ON ((ce.criteriafid = bd.criteria_id)))
              WHERE (((((fce.feqfid = st.id) AND (fce.reportfid = 30)) AND (rrs.sitefid = 3)) AND ((fce.restrictionflag)::text = 'yes'::text)) AND (bd.qualifier_id = 3)))
            ELSE 0
        END AS display_st,
        CASE
            WHEN (ro.id IS NOT NULL) THEN ( SELECT COALESCE(max(bd.display), 1) AS "coalesce"
               FROM ((((feqcriteriaentry fce
                 JOIN criteriaentry ce ON ((fce.criteriaentryfid = ce.id)))
                 JOIN restrictionreport rr ON ((fce.reportfid = rr.id)))
                 JOIN restrictionreportsite rrs ON ((rr.id = rrs.reportfid)))
                 JOIN bms_restriction_code_display bd ON ((ce.criteriafid = bd.criteria_id)))
              WHERE (((((fce.feqfid = ro.id) AND (fce.reportfid = 30)) AND (rrs.sitefid = 3)) AND ((fce.restrictionflag)::text = 'yes'::text)) AND (bd.qualifier_id = 4)))
            ELSE 0
        END AS display_or,
        CASE
            WHEN (pa.id IS NOT NULL) THEN 1
            ELSE 0
        END AS original_pa,
        CASE
            WHEN (ql.id IS NOT NULL) THEN 1
            ELSE 0
        END AS original_ql,
        CASE
            WHEN (st.id IS NOT NULL) THEN 1
            ELSE 0
        END AS original_st,
        CASE
            WHEN (ro.id IS NOT NULL) THEN 1
            ELSE 0
        END AS original_or
   FROM ((((((healthplan hp
     JOIN formularyentry fe ON ((hp.formularyfid = fe.formularyfid)))
     LEFT JOIN formularyentryqualifier pa ON (((fe.id = pa.formularyentryfid) AND (pa.qualifierfid = 2))))
     LEFT JOIN formularyentryqualifier ql ON (((fe.id = ql.formularyentryfid) AND (ql.qualifierfid = 1))))
     LEFT JOIN formularyentryqualifier st ON (((fe.id = st.formularyentryfid) AND (st.qualifierfid = 3))))
     LEFT JOIN formularyentryqualifier ro ON (((fe.id = ro.formularyentryfid) AND (ro.qualifierfid = 4))))
     LEFT JOIN reasoncode rc ON ((fe.reasoncodefid = rc.id)))
  WHERE ((hp.isactive IS TRUE) AND (fe.drugfid = 2767));


ALTER TABLE view_orencia_sc_formulary_entries OWNER TO postgres;

--
-- TOC entry 2360 (class 1259 OID 42347)
-- Name: view_takeda_managed_markets_drugs; Type: VIEW; Schema: public; Owner: postgres
--

CREATE VIEW view_takeda_managed_markets_drugs AS
 SELECT healthplan.id AS "Plan_ID",
    drugclass.id AS "Product_Class_ID",
    replace(replace((drugclass.name)::text, ' (pseudo)'::text, ''::text), ' (Pseudo)'::text, ''::text) AS "Product_Class_Name",
    drug.id AS "Product_ID",
    drug.name AS "Product_Name",
    tier.id AS "Tier",
    tier.name AS "Tier_Description",
    qualifier.codename AS "Restriction_Code",
    qualifier.name AS "Restriction_Description",
    reasoncode.code AS "Reason_Code",
    reasoncode.webtext AS "Reason_Description"
   FROM (((((((((healthplan
     JOIN formularyentry ON ((healthplan.formularyfid = formularyentry.formularyfid)))
     JOIN drug ON ((formularyentry.drugfid = drug.id)))
     JOIN drugdrugclass ON ((drug.id = drugdrugclass.drugfid)))
     JOIN drugclass ON ((drugdrugclass.drugclassfid = drugclass.id)))
     JOIN tier ON ((formularyentry.tierfid = tier.id)))
     JOIN formulary ON ((healthplan.formularyfid = formulary.id)))
     LEFT JOIN reasoncode ON ((formularyentry.reasoncodefid = reasoncode.id)))
     LEFT JOIN formularyentryqualifier ON ((formularyentry.id = formularyentryqualifier.formularyentryfid)))
     LEFT JOIN qualifier ON ((formularyentryqualifier.qualifierfid = qualifier.id)))
  WHERE ((healthplan.isactive IS TRUE) AND (drugclass.id = ANY (ARRAY[59, 61, 161, 163, 178, 246])))
  ORDER BY healthplan.id, drugclass.id, drug.id;


