--
-- TOC entry 2363 (class 1259 OID 42364)
-- Name: wk_plan_health_plan_allocations_view; Type: VIEW; Schema: public; Owner: postgres
--

CREATE VIEW wk_plan_health_plan_allocations_view AS
 SELECT health_plans_wk_plans.health_plan_id,
    health_plans_wk_plans.wk_plan_id,
    health_plan_count.count AS health_plan_count,
    health_plan_lives.lives AS health_plan_lives,
    wk_plan_lives.lives AS wk_plan_lives,
        CASE
            WHEN (wk_plan_lives.lives = (0)::numeric) THEN 'health_plan_count'::text
            ELSE 'lives'::text
        END AS allocation_paradigm,
        CASE
            WHEN (wk_plan_lives.lives = (0)::numeric) THEN (1.0 / (health_plan_count.count)::numeric)
            ELSE (health_plan_lives.lives / wk_plan_lives.lives)
        END AS allocation
   FROM ((((health_plans_wk_plans
     JOIN healthplan ON (((healthplan.id = health_plans_wk_plans.health_plan_id) AND (healthplan.isactive = true))))
     JOIN ( SELECT wk_plans.id AS wk_plan_id,
            ( SELECT count(1) AS count
                   FROM (health_plans_wk_plans health_plans_wk_plans_1
                     JOIN healthplan healthplan_1 ON (((health_plans_wk_plans_1.health_plan_id = healthplan_1.id) AND (healthplan_1.isactive = true))))
                  WHERE (health_plans_wk_plans_1.wk_plan_id = wk_plans.id)) AS count
           FROM wk_plans) health_plan_count ON ((health_plan_count.wk_plan_id = health_plans_wk_plans.wk_plan_id)))
     JOIN ( SELECT healthplan_1.id AS health_plan_id,
            ( SELECT COALESCE(sum(healthplan_countylives.lives), (0)::numeric) AS "coalesce"
                   FROM healthplan_countylives
                  WHERE (healthplan_countylives.healthplanfid = healthplan_1.id)) AS lives
           FROM healthplan healthplan_1
          WHERE (healthplan_1.isactive = true)) health_plan_lives ON ((health_plan_lives.health_plan_id = health_plans_wk_plans.health_plan_id)))
     JOIN ( SELECT wk_plans.id AS wk_plan_id,
            ( SELECT COALESCE(sum(healthplan_countylives.lives), (0)::numeric) AS "coalesce"
                   FROM ((health_plans_wk_plans health_plans_wk_plans_1
                     JOIN healthplan healthplan_1 ON (((health_plans_wk_plans_1.health_plan_id = healthplan_1.id) AND (healthplan_1.isactive = true))))
                     JOIN healthplan_countylives ON ((healthplan_countylives.healthplanfid = healthplan_1.id)))
                  WHERE (health_plans_wk_plans_1.wk_plan_id = wk_plans.id)) AS lives
           FROM wk_plans) wk_plan_lives ON ((wk_plan_lives.wk_plan_id = health_plans_wk_plans.wk_plan_id)));


ALTER TABLE wk_plan_health_plan_allocations_view OWNER TO postgres;

